import React from "react";

const SignIn = ({ data, onClick }) => {
  return (
    <>
      <div className="cw__verify-wrapper">
            <label>
              <input
                type="checkbox"
                checked={data}
                onChange={onClick}
              />
              <span className="cw__checkmark"></span>
              I agree to the terms & conditions
            </label>
      </div>
    </>
  );
};
export default SignIn;
